import React from 'react'

class User extends React.Component {
    render() {
        return (
            <div>
                <div>Welcome, {this.props.currentUser.username}</div>
                <div>
                    <span>Account data:</span>
                    {this.props.currentUser.avatar ? 
                        <div>{this.props.currentUser.avatar}</div>
                        :
                        <div><img src="https://www.travelcontinuously.com/wp-content/uploads/2018/04/empty-avatar.png" alt="Empty avatar" /></div>
                    }
                    {this.props.currentUser.bio ?
                        <div>{this.props.currentUser.bio}</div>
                        :
                        <div>Tell us about yourself...</div>
                    }
                </div>
            </div>
        )
    }
}

export default User
